import React, { useState, useEffect } from 'react';
import styles from '../Auth/Lore.module.css';
import { Link } from 'react-router-dom';
import axios from 'axios';

const Regist = () => {
  const postData = () => {
    axios.post('');
  };

  return (
    <div className={styles.regist}>
      <img width={60} height={60} src="./img/logo.png" alt="" />
      <input className={styles.inpt} placeholder="Email" type="email" />
      <input className={styles.inpt} placeholder="Username" type="text" />
      <input className={styles.inpt} placeholder="Firstname" type="text" />
      <input className={styles.inpt} placeholder="Secondname" type="text" />
      <input className={styles.inpt} placeholder="Phone" type="tel" />
      <input className={styles.inpt} placeholder="Password" type="password" />
      <input className={styles.inpt} placeholder="Password2" type="password" />
      <Link>
        <button>regist</button>
      </Link>
    </div>
  );
};

export default Regist;
